import React from 'react'
import styled from 'styled-components'

const Cont = styled.div`

`
const Text = styled.h1`
  font-size: 20px;
font-weight: bold;
  `

function Tahun() {
  return (
   <Cont>
     <Text> Tahun 2020</Text>
   </Cont>
  )
}

export default Tahun
